module.exports = {
	createElementsCopy: function(elements) {
		var elementsCopy = {};
		elementsCopy.epiNodes = elements.epiNodes;
		elementsCopy.stromaNodes = elements.stromaNodes;
		elementsCopy.edges = elements.edges;
		elementsCopy.epiParent = elements.epiParent;
		elementsCopy.stromaParent = elements.stromaParent;

		return elementsCopy;
	}
};